function Header() {
  return (
    <header className="header">
      <img src={headerLogo} className="header__logo" alt="логотип" />
      <div className="header__auth-container">
        <h3 className="header__account header__button">user@user.ru</h3>
        <h3 className="header__logout header__button">Выйти</h3>
      </div>
    </header>
  );
}

export default Header;
